import React from "react"
import {Link } from "react-scroll"

const Navigation = () => {
  return (
    <div className="navigation">
      <Link to="accueil" spy={true} smooth={true} offset={-500} duration={500}>Qui suis-je?</Link>
      <Link to="portfolio" spy={true} smooth={true} offset={-1000} duration={500}>Portfolio</Link>
    </div>
  )
}
export default Navigation
